function formatDate(n){var t=new Date(n).getDay(),i=new Date(n).getDate();return(t.toString().length===1?"0":"")+t+"/"+(i.toString().length===1?"0":"")+i+"/"+new Date(n).getFullYear()}var Load=()=>{$.get("/api/values",function(n){var t="";for(var i in n)t+="<tr><td>"+n[i].user.name+"<\/td>",t+="<td>"+n[i].user.emailId+"<\/td>",t+="<td>"+n[i].user.gender.value+"<\/td>",t+="<td>"+formatDate(n[i].dateRegistered)+"<\/td>",t+="<td>"+n[i].registrationDay.map(n=>n.eventDay.label)+"<\/td>",t+="<td>"+n[i].additionalRequest+"<\/td><\/tr>";$(".result").html(t);setTimeout(function(){$(".loader").hide()},500)}).fail(function(){alert("Sorry! Something went wrong")})};